    return(
        <div classname="main" align="center">
          <br/>
          <br/>

          <h1>Personal Details</h1>
        <div className="ui card centered">
        <div className="image">
            <img src={prof} alt=""/>
            <div className="content">
            <div className="header"><h2>Madan Mohan</h2></div>
            <div className="descriptuin"><p>Vrindavan vasi</p></div>
        </div>
        </div>
        </div>


        </div>
    );
}


export default Details;
